import React, { useState } from "react";
import Pokecard1 from "./Pokecard1";

function App() {
  let arr = [];
  for (let i = 0; i < 6; i++) {
    arr.push(Math.floor(Math.random() * 20));
  }
  // img={`https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/${arr}.png`}/
  return <Pokecard1 name="hi" />;
}

export default App;
